import { Container, Smartmobile, PurpleCircle, Entrar, Button1, Button2,
   Inputs, Input } from "./styles/StyleLogin";

const Home = () => {
  
  const [loaded] = useFonts({
    MajorMonoDisplay: require('./fonts/MajorMonoDisplay-Regular.ttf'),
  });
  
  if (!loaded) {
    return null;
  }
  

    return (
        <Container> 
         <Smartmobile style={{ fontFamily: 'MajorMonoDisplay' }}> Home </Smartmobile> 
        </Container>
    );
  };

